import Slide from "../components/slider"
import Navigator from "../components/navigator"
import Gambar_galery from "../components/galery"
import Footer from "../components/footer"

function TestDrive() {
    return (
        <>
            <Slide/>
            <Navigator/>
            <Gambar_galery/>
            <Footer/>
        </>
    )

}
export default TestDrive;
